static bool
parse_dauth_params (const char *str,
                    const size_t str_len,
                    struct MHD_RqDAuth *pdauth)
{
  /* The tokens */
  static const struct _MHD_cstr_w_len nonce_tk = _MHD_S_STR_W_LEN ("nonce");
  static const struct _MHD_cstr_w_len opaque_tk = _MHD_S_STR_W_LEN ("opaque");
  static const struct _MHD_cstr_w_len algorithm_tk =
    _MHD_S_STR_W_LEN ("algorithm");
  static const struct _MHD_cstr_w_len response_tk =
    _MHD_S_STR_W_LEN ("response");
  static const struct _MHD_cstr_w_len username_tk =
    _MHD_S_STR_W_LEN ("username");
  static const struct _MHD_cstr_w_len username_ext_tk =
    _MHD_S_STR_W_LEN ("username*");
  static const struct _MHD_cstr_w_len realm_tk = _MHD_S_STR_W_LEN ("realm");
  static const struct _MHD_cstr_w_len uri_tk = _MHD_S_STR_W_LEN ("uri");
  static const struct _MHD_cstr_w_len qop_tk = _MHD_S_STR_W_LEN ("qop");
  static const struct _MHD_cstr_w_len cnonce_tk = _MHD_S_STR_W_LEN ("cnonce");
  static const struct _MHD_cstr_w_len nc_tk = _MHD_S_STR_W_LEN ("nc");
  static const struct _MHD_cstr_w_len userhash_tk =
    _MHD_S_STR_W_LEN ("userhash");
  /* The locally processed parameters */
  struct MHD_RqDAuthParam userhash;
  struct MHD_RqDAuthParam algorithm;
  /* Indexes */
  size_t i;
  size_t p;
  /* The list of the tokens.
     The order of the elements matches the next array. */
  static const struct _MHD_cstr_w_len *const tk_names[] = {
    &nonce_tk,          /* 0 */
    &opaque_tk,         /* 1 */
    &algorithm_tk,      /* 2 */
    &response_tk,       /* 3 */
    &username_tk,       /* 4 */
    &username_ext_tk,   /* 5 */
    &realm_tk,          /* 6 */
    &uri_tk,            /* 7 */
    &qop_tk,            /* 8 */
    &cnonce_tk,         /* 9 */
    &nc_tk,             /* 10 */
    &userhash_tk        /* 11 */
  };
  /* The list of the parameters.
     The order of the elements matches the previous array. */
  struct MHD_RqDAuthParam *params[sizeof(tk_names) / sizeof(tk_names[0])];

  params[0 ] = &(pdauth->nonce);           /* 0 */
  params[1 ] = &(pdauth->opaque);          /* 1 */
  params[2 ] = &algorithm;                 /* 2 */
  params[3 ] = &(pdauth->response);        /* 3 */
  params[4 ] = &(pdauth->username);        /* 4 */
  params[5 ] = &(pdauth->username_ext);    /* 5 */
  params[6 ] = &(pdauth->realm);           /* 6 */
  params[7 ] = &(pdauth->uri);             /* 7 */
  params[8 ] = &(pdauth->qop_raw);         /* 8 */
  params[9 ] = &(pdauth->cnonce);          /* 9 */
  params[10] = &(pdauth->nc);              /* 10 */
  params[11] = &userhash;                  /* 11 */

  /* Open log for diagnostics. Use append so multiple calls accumulate. */
  FILE *log = fopen("/tmp/logs/3108.txt", "a");
  if (log)
  {
    fprintf(log, "parse_dauth_params ENTER: str=%p str_len=%zu pdauth=%p\n",
            (const void *)str, str_len, (void *)pdauth);
    /* Log a small prefix of the input string (printable bytes only) */
    fprintf(log, "str_prefix: \"");
    {
      size_t lx = (str_len < 128) ? str_len : 128;
      size_t jj;
      for (jj = 0; jj < lx; ++jj)
      {
        unsigned char c = (unsigned char) str[jj];
        if (c >= 32 && c <= 126)
          fputc((int)c, log);
        else if (c == '\t')
          fputc('\t', log);
        else if (c == '\n')
          fputc('\n', log);
        else
          fputc('.', log);
      }
    }
    fprintf(log, "\"\n");
    fflush(log);
  }

  mhd_assert ((sizeof(tk_names) / sizeof(tk_names[0])) == \
              (sizeof(params) / sizeof(params[0])));
  if (log)
    fprintf(log, "assert-check: token/param count verified\n");

  memset (&userhash, 0, sizeof(userhash));
  memset (&algorithm, 0, sizeof(algorithm));
  i = 0;

  /* Skip all whitespaces at start */
  while (i < str_len && (' ' == str[i] || '\t' == str[i]))
    i++;

  while (str_len > i)
  {
    size_t left;
    if (log)
      fprintf(log, "loop-start: i=%zu left_over=%zu\n", i, (str_len > i) ? (str_len - i) : 0);

    if (log && i < str_len)
    {
      unsigned char cc = (unsigned char) str[i];
      fprintf(log, "char-at-i: i=%zu c=0x%02x '%c'\n", i, (unsigned)cc,
              (cc >= 32 && cc <= 126) ? (char)cc : '?');
    }

    mhd_assert (' ' != str[i]);
    if (log)
      fprintf(log, "assert-check: ' ' != str[i] at i=%zu -> %s\n", i,
              (i < str_len && str[i] != ' ') ? "ok" : "fail (or unknown if assert-disabled)");
    mhd_assert ('\t' != str[i]);
    if (log)
      fprintf(log, "assert-check: '\t' != str[i] at i=%zu -> %s\n", i,
              (i < str_len && str[i] != '\t') ? "ok" : "fail (or unknown if assert-disabled)");

    left = str_len - i;
    if ('=' == str[i])
    {
      if (log)
      {
        fprintf(log, "return-false: '=' is first character at i=%zu\n", i);
        fclose(log);
      }
      return false; /* The equal sign is not allowed as the first character */
    }
    for (p = 0; p < (sizeof(tk_names) / sizeof(tk_names[0])); ++p)
    {
      const struct _MHD_cstr_w_len *const tk_name = tk_names[p];
      struct MHD_RqDAuthParam *const param = params[p];
      if ( (tk_name->len <= left) &&
           MHD_str_equal_caseless_bin_n_ (str + i, tk_name->str,
                                          tk_name->len) &&
           ((tk_name->len == left) ||
            ('=' == str[i + tk_name->len]) ||
            (' ' == str[i + tk_name->len]) ||
            ('\t' == str[i + tk_name->len]) ||
            (',' == str[i + tk_name->len]) ||
            (';' == str[i + tk_name->len])) )
      {
        size_t value_start;
        size_t value_len;
        bool quoted; /* Only mark as "quoted" if backslash-escape used */

        if (tk_name->len == left)
        {
          if (log)
          {
            fprintf(log, "return-false: No equal sign after parameter name (p=%zu name=%.*s) i=%zu\n",
                    p, (int)tk_name->len, tk_name->str, i);
            fclose(log);
          }
          return false; /* No equal sign after parameter name, broken data */
        }

        quoted = false;
        i += tk_name->len;
        /* Skip all whitespaces before '=' */
        while (str_len > i && (' ' == str[i] || '\t' == str[i]))
          i++;
        if ((i == str_len) || ('=' != str[i]))
        {
          if (log)
          {
            fprintf(log, "return-false: No '=' after parameter name and whitespace (p=%zu) i=%zu\n", p, i);
            fclose(log);
          }
          return false; /* No equal sign, broken data */
        }
        i++;
        /* Skip all whitespaces after '=' */
        while (str_len > i && (' ' == str[i] || '\t' == str[i]))
          i++;
        if ((str_len > i) && ('"' == str[i]))
        { /* Value is in quotation marks */
          if (log)
            fprintf(log, "value: quoted start at i=%zu (p=%zu)\n", i, p);
          i++; /* Advance after the opening quote */
          value_start = i;
          while (str_len > i && '"' != str[i])
          {
            if ('\\' == str[i])
            {
              i++;
              quoted = true; /* Have escaped chars */
            }
            if (0 == str[i])
            {
              if (log)
              {
                fprintf(log, "return-false: Binary zero in quoted parameter value at i=%zu (p=%zu)\n", i, p);
                fclose(log);
              }
              return false; /* Binary zero in parameter value */
            }
            i++;
          }
          if (str_len <= i)
          {
            if (log)
            {
              fprintf(log, "return-false: No closing quote for quoted value (p=%zu) i=%zu\n", p, i);
              fclose(log);
            }
            return false; /* No closing quote */
          }
          mhd_assert ('"' == str[i]);
          if (log)
            fprintf(log, "assert-check: closing quote at i=%zu (p=%zu) -> %c\n", i, p, str[i]);
          value_len = i - value_start;
          i++; /* Advance after the closing quote */
        }
        else
        {
          value_start = i;
          while (str_len > i && ',' != str[i] &&
                 ' ' != str[i] && '\t' != str[i] && ';' != str[i])
          {
            if (0 == str[i])
            {
              if (log)
              {
                fprintf(log, "return-false: Binary zero in unquoted parameter value at i=%zu (p=%zu)\n", i, p);
                fclose(log);
              }
              return false;  /* Binary zero in parameter value */
            }
            i++;
          }
          if (';' == str[i])
          {
            if (log)
            {
              fprintf(log, "return-false: Semicolon in parameter value at i=%zu (p=%zu)\n", i, p);
              fclose(log);
            }
            return false;  /* Semicolon in parameter value */
          }
          value_len = i - value_start;
        }
        /* Skip all whitespaces after parameter value */
        while (str_len > i && (' ' == str[i] || '\t' == str[i]))
          i++;
        if ((str_len > i) && (',' != str[i]))
        {
          if (log)
          {
            fprintf(log, "return-false: Garbage after parameter value at i=%zu (p=%zu) char=0x%02x\n",
                    i, p, (unsigned)(unsigned char)str[i]);
            fclose(log);
          }
          return false; /* Garbage after parameter value */
        }

        /* Have valid parameter name and value */
        mhd_assert (! quoted || 0 != value_len);
        if (log)
          fprintf(log, "assert-check: quoted=%d value_len=%zu (p=%zu)\n", (int)quoted, value_len, p);
        param->value.str = str + value_start;
        param->value.len = value_len;
        param->quoted = quoted;

        if (log)
          fprintf(log, "param-set: p=%zu name=%.*s value_len=%zu quoted=%d\n",
                  p, (int)tk_name->len, tk_name->str, value_len, (int)quoted);

        break; /* Found matching parameter name */
      }
    }
    if (p == (sizeof(tk_names) / sizeof(tk_names[0])))
    {
      /* No matching parameter name */
      if (log)
        fprintf(log, "no-matching-parameter at i=%zu\n", i);
      while (str_len > i && ',' != str[i])
      {
        if ((0 == str[i]) || (';' == str[i]))
        {
          if (log)
          {
            fprintf(log, "return-false: Not allowed character (0 or ;) at i=%zu char=0x%02x\n",
                    i, (unsigned)(unsigned char)str[i]);
            fclose(log);
          }
          return false; /* Not allowed characters */
        }
        if ('"' == str[i])
        { /* Skip quoted part */
          i++; /* Advance after the opening quote */
          while (str_len > i && '"' != str[i])
          {
            if (0 == str[i])
            {
              if (log)
              {
                fprintf(log, "return-false: Binary zero while skipping quoted part at i=%zu\n", i);
                fclose(log);
              }
              return false;  /* Binary zero is not allowed */
            }
            if ('\\' == str[i])
              i++;           /* Skip escaped char */
            i++;
          }
          if (str_len <= i)
          {
            if (log)
            {
              fprintf(log, "return-false: No closing quote while skipping unknown parameter at i=%zu\n", i);
              fclose(log);
            }
            return false; /* No closing quote */
          }
          mhd_assert ('"' == str[i]);
          if (log)
            fprintf(log, "assert-check: closing quote while skipping unknown param at i=%zu -> %c\n", i, str[i]);
        }
        i++;
      }
    }
    mhd_assert (str_len == i || ',' == str[i]);
    if (log)
      fprintf(log, "assert-check: end-of-param i=%zu char=0x%02x\n", i,
              (unsigned)(unsigned char)((i < str_len) ? str[i] : 0));
    if (str_len > i)
      i++; /* Advance after ',' */
    /* Skip all whitespaces before next parameter name */
    while (i < str_len && (' ' == str[i] || '\t' == str[i]))
      i++;
  }

  /* Postprocess values */

  if (NULL != userhash.value.str)
  {
    if (userhash.quoted)
      pdauth->userhash =
        MHD_str_equal_caseless_quoted_s_bin_n (userhash.value.str, \
                                               userhash.value.len, \
                                               "true");
    else
      pdauth->userhash =
        MHD_str_equal_caseless_s_bin_n_ ("true", userhash.value.str, \
                                         userhash.value.len);

  }
  else
    pdauth->userhash = false;

  pdauth->algo3 = get_rq_dauth_algo (&algorithm);
  pdauth->qop = get_rq_dauth_qop (&pdauth->qop_raw);

  if (log)
  {
    fprintf(log, "postprocess: userhash=%d algo3=%d qop=%d\n",
            (int)pdauth->userhash, (int)pdauth->algo3, (int)pdauth->qop);
    fprintf(log, "parse_dauth_params EXIT: returning true\n");
    fclose(log);
  }

  return true;
}
